import { Link } from 'react-router-dom'
 
function Header() {
    return (
        <nav>
            <img src="../style/images/logo.svg"/>
            <Link to="/">Accueil</Link>
            <Link to="/Apropos">A propos</Link>
            <Link to="/Logement">Logement</Link>
        </nav>
    )
}

export default Header
